import React from "react";

export default function About() {
  return (
    <div className="max-w-3xl mx-auto p-6 bg-white dark:bg-gray-800 rounded-xl shadow-lg space-y-4">
      <h1 className="text-3xl font-bold text-gray-900 dark:text-white">About</h1>
      <p className="text-gray-700 dark:text-gray-200">
        This project is built with React and will connect to a backend API to deliver AI-powered health recommendations and disaster alerts.
      </p>
    </div>
  );
}
